apaneseLine":"「あーい、ありがとござやーす」","translatedEnglishLine":"\"Alright, thank you very much.\""},{"lineNumber":88030,"originalJapaneseLine":"「慣れやがった……","translatedEnglishLine":"\"You've gotten used to this..."},{"lineNumber":88031,"originalJapaneseLine":"　面白くない」","translatedEnglishLine":"Not funny.\""},{"lineNumber":88032,"originalJapaneseLine":"「んじゃ、服返してくだせえ」","translatedEnglishLine":"\"Then, please give me back my clothes.\""},{"lineNumber":88033,"originalJapaneseLine":"「だめ」","translatedEnglishLine":"\"No.\""},{"lineNumber":88034,"originalJapaneseLine":"「鬼」","translatedEnglishLine":"\"Demon.\""},{"lineNumber":88035,"originalJapaneseLine":"「皆のアイドル！","translatedEnglishLine":"\"Everyone's idol!"},{"lineNumber":88036,"originalJapaneseLine":"　フロストバインちゃん参戦じゃ〜！」","translatedEnglishLine":"Frostvine-chan joins the battle~!\""},{"lineNumber":88037,"originalJapaneseLine":"「おう、坊主たちかい。","translatedEnglishLine":"\"Oh, you boys, huh."},{"lineNumber":88038,"originalJapaneseLine":"　おはようさん」","translatedEnglishLine":"Good morning.\""},{"lineNumber":88039,"originalJapaneseLine":"「げっ、ババア」","translatedEnglishLine":"\"Ugh, old hag.\""},{"lineNumber":88040,"originalJapaneseLine":"「げっ、とはどういう意味じゃ、失礼な」","translatedEnglishLine":"\"What's with the 'ugh'? How rude.\""},{"lineNumber":88041,"originalJapaneseLine":"「失礼なのはおのれのデカい顔だ。","translatedEnglishLine":"\"The rude one is your big face."},{"lineNumber":88042,"originalJapaneseLine":"　朝っぱらから俺の体力がずずーんと削られたぞ」","translatedEnglishLine":"You've drained my energy first thing in the morning.\""},{"lineNumber":88043,"originalJapaneseLine":"「くっ、相変わらず小憎たらしいガキじゃのう」","translatedEnglishLine":"\"Ugh, you're as pesky a brat as ever.\""},{"lineNumber":88044,"originalJapaneseLine":"「しかし、そんなお前さんが今じゃ総統とは……","translatedEnglishLine":"\"But for someone like you to be the Commander now..."},{"lineNumber":88045,"originalJapaneseLine":"　憎まれっ子世にはばかる、という奴か」","translatedEnglishLine":"I guess it's true what they say: 'The hated child prospers.'\""},{"lineNumber":88046,"originalJapaneseLine":"「そのことわざ通りだってんなら、","translatedEnglishLine":"\"If that proverb is true,"},{"lineNumber":88047,"originalJapaneseLine":"　ばあさんももっと世にはばかってなきゃ","translatedEnglishLine":"then you, granny, should be prospering a lot more,"},{"lineNumber":88048,"originalJapaneseLine":"　おかしくねーっすかねー」","translatedEnglishLine":"isn't that weird?\""},{"lineNumber":88049,"originalJapaneseLine":"「……どういう意味じゃ？」","translatedEnglishLine":"\"...What do you mean by that?\""},{"lineNumber":88050,"originalJapaneseLine":"「いや、その顔のでかさは","translatedEnglishLine":"\"No, with a face that big,"},{"lineNumber":88051,"originalJapaneseLine":"　充分はばかりまくってるぞ」","translatedEnglishLine":"you're definitely prospering a lot.\""},{"lineNumber":88052,"originalJapaneseLine":"「やかましいわい！」","translatedEnglishLine":"\"Shut up!\""},{"lineNumber":88053,"originalJapaneseLine":"「ぐっすん、皆してそうやって","translatedEnglishLine":"\"Sniff, they all bully a frail old lady like this,"},{"lineNumber":88054,"originalJapaneseLine":"　か弱い老人を苛めるんじゃな、ふんっ、ふんっ。","translatedEnglishLine":"hurting a weak old lady, hmpf, hmpf."},{"lineNumber":88055,"originalJapaneseLine":"　もうええわい、いじけいじけ〜」","translatedEnglishLine":"That's enough, I'm sulking now~\""},{"lineNumber":88056,"originalJapaneseLine":"「げ、元気出して下さい、フロストバインさん」","translatedEnglishLine":"\"Eh, cheer up, Frostvine-san.\""},{"lineNumber":88057,"originalJapaneseLine":"「うう、儂に優しくしてくれるのは、","translatedEnglishLine":"\"Ugh, the only one kind to me is"},{"lineNumber":88058,"originalJapaneseLine":"　お嬢ちゃんくらいじゃ。","translatedEnglishLine":"this young lady here."},{"lineNumber":88059,"originalJapaneseLine":"　世の中捨てたもんじゃないのう」","translatedEnglishLine":"The world isn't all bad.\""},{"lineNumber":88060,"originalJapaneseLine":"「べっこう飴食べるかい？」","translatedEnglishLine":"\"Want some amber candy?\""},{"lineNumber":88061,"originalJapaneseLine":"「わーい、いただきます」","translatedEnglishLine":"\"Yay, thank you!\""},{"lineNumber":88062,"originalJapaneseLine":"「きっと毒があるぞ。","translatedEnglishLine":"\"It's surely poisoned."},{"lineNumber":88063,"originalJapaneseLine":"　捨てろ捨てろ」","translatedEnglishLine":"Throw it away, throw it away.\""},{"lineNumber":88064,"originalJapaneseLine":"「毒なんぞないわい！」","translatedEnglishLine":"\"There's no poison!\""},{"lineNumber":88065,"originalJapaneseLine":"「ぎゃー！　大変だー！」","translatedEnglishLine":"\"Ahhh! It's terrible!\""},{"lineNumber":88066,"originalJapaneseLine":"「やかましいぞタマ。","translatedEnglishLine":"\"Quiet, Tama."},{"lineNumber":88067,"originalJapaneseLine":"　何を騒いでる」","translatedEnglishLine":"What are you making such a fuss about?\""},{"lineNumber":88068,"originalJapaneseLine":"「どうしたんですか？」","translatedEnglishLine":"\"What's wrong?\""},{"lineNumber":88069,"originalJapaneseLine":"「そ、それが……婆の部屋の掃除してたら、","translatedEnglishLine":"\"W-well... while cleaning old lady's room,"},{"lineNumber":88070,"originalJapaneseLine":"　五百年前の写真が出てきたんすけど……」","translatedEnglishLine":"I found a photo from 500 years ago...\""}]}

